      out.write("	// opnshift provisioning Template Param 데이터\n");
      out.write("	function openshiftTemplateSave(){\n");
      out.write("\n");
      out.write("		if($(\"#appNameChkFlag\").val() === \"Y\" && $(\"#appNameChk\").val() === \"N\"){\n");
      out.write("			return false;\n");
      out.write("		}\n");
