      out.write("		var grp = $(\"input.parameterClass\").length;\n");
      out.write("		var parameterValue = \"\";\n");
      out.write("		//배열 생성\n");
      out.write("		var grparr = new Array(grp);\n");
      out.write("		//배열에 값 주입\n");
      out.write("		for(var i=0; i<grp; i++){\n");
      out.write("			var paramClassValue = $(\"input.parameterClass\").eq(i).val();\n");
      out.write("\n");
      out.write("			if($(\"input.parameterClass\").eq(i).data(\"expression\") == \"expression\"){\n");
      out.write("				var exp = RegExp($(\"input.parameterClass\").eq(i).data(\"from\"));\n");
      out.write("				/*if(!exp.test(v)){\n");
      out.write("					alertBox($(\"input.parameterClass\").eq(i).data(\"key\") + \"필드의 값이 잘못되었습니다.\");\n");
      out.write("					return false;\n");
      out.write("				} */\n");
      out.write("				paramClassValue += new RandExp(exp).gen();\n");
      out.write("			}\n");
      out.write("\n");
      out.write("			if($(\"input.parameterClass\").eq(i).data(\"key\") === \"APPLICATION_NAME\"){\n");
      out.write("				paramClassValue = paramClassValue.toLowerCase();\n");
      out.write("			}else if($(\"input.parameterClass\").eq(i).data(\"key\") === \"BROKER_XML\" || $(\"input.parameterClass\").eq(i).data(\"key\") === \"LOGGING_PROPERTIES\"){\n");
      out.write("				if(paramClassValue != 'Y') continue;\n");
      out.write("			}\n");
      out.write("			parameterValue += $(\"input.parameterClass\").eq(i).data(\"key\")+\"=\" + paramClassValue;\n");
      out.write("\n");
      out.write("			if(i+1 != grp){\n");
      out.write("				parameterValue += \"&\";\n");
      out.write("			}\n");
      out.write("		}\n");
      out.write("		$(\"#params\").val(parameterValue);\n");
      out.write("	}\n");
